import AppLayout from '../../components/layout/AppLayout';

function createMovieTalk() {
    return (
        <AppLayout>
            <div>
                무비톡 작성 페이지
            </div>
            <div>포스터</div>
            <div>00님의 리뷰</div>
            <div>영화 이름(연도)</div>
            <textarea placeholder="영화 리뷰를 적어주세요."></textarea>
        </AppLayout>
    )
}

export default createMovieTalk
